var title_f32_19_33079="Chronic eosinophilic leukemia with FIP1L1-PDGFRA";
var content_f32_19_33079=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F88547&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F88547&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Chronic eosinophilic leukemia with FIP1L1-PDGFRA",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 419px; height: 514px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Peripheral blood (panels A-B) and bone marrow aspirate (panel C) samples from a patient with myeloproliferative neoplasm with eosinophilia and abnormalities of PDGFRA.&nbsp;The peripheral blood film shows eosinophils with abnormal size, granulation, and nuclear lobulation. Red blood cells and platelets are normal and there are no circulating blast cells. The bone marrow exhibits eosinophilic hyperplasia and increased myeloid blast cells (panel C;&nbsp;white arrows show blast cells). Abnormal eosinophils with dysplastic granules are present.",
"    <br>",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      This research was originally published in Blood. Verdu J, de Paz F. Chronic eosinophilic leukemia with FIP1L1-PDGFRA. Blood 2013; 121:1254. Copyright &copy; 2013 The American Society of Hematology.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
