"   <div class=\"block pha drugH1Div\" id=\"F1054943\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Stabilizes neuronal membranes and decreases seizure activity by increasing efflux or decreasing influx of sodium ions across cell membranes in the motor cortex during generation of nerve impulses; prolongs effective refractory period and suppresses ventricular pacemaker automaticity, shortens action potential in the heart",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F1054960\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacokinetics (Adult data unless noted)",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Slow, variable; dependent on product formulation; decreased in neonates",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     :",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Neonates:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Premature: 1-1.2 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Full-term: 0.8-0.9 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Infants: 0.7-0.8 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children: 0.7 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults: 0.6-0.7 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Adults: 90% to 95%; Neonates: Increased free fraction of phenytoin (up to 20%) and decreased protein binding; Infants: Increased free fraction of phenytoin (up to 15%) and decreased protein binding; also increased free fraction in patients with hyperbilirubinemia, hypoalbuminemia, renal dysfunction, or uremia",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Follows dose-dependent (Michaelis-Menten) pharmacokinetics; &ldquo;apparent&rdquo; or calculated half-life is dependent upon serum concentration, therefore, metabolism is best described in terms of K",
"     <sub>",
"      m",
"     </sub>",
"     and V",
"     <sub>",
"      max",
"     </sub>",
"     ; V",
"     <sub>",
"      max",
"     </sub>",
"     is increased in infants &gt;6 months and children compared to adults; major metabolite (via oxidation) HPPA undergoes enterohepatic recycling and elimination in urine as glucuronides",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Formulation dependent",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 7-42 hours; in newborns (PNA &lt;7 days): Half-life greatly increased (clearance decreased) and then rapidly accelerates to infant levels by 5 weeks of life;",
"     <b>",
"      Note:",
"     </b>",
"     Elimination is not first-order and follows Michaelis-Menten pharmacokinetics; half-life increases with increasing phenytoin concentrations",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak serum concentration: Oral: Dependent upon formulation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Extended release capsule: Within 4-12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Immediate release preparation: Within 2-3 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Elimination: &lt;5% excreted unchanged in urine; increased clearance and decreased serum concentrations with febrile illness; highly variable clearance, dependent upon intrinsic hepatic function and dose administered",
"    </p>",
"   </div>",
"   <div class=\"block pai drugH1Div\" id=\"F1054951\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Patient Information",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_patient\" href=\"mobipreview.htm?7/49/7958?source=see_link\">",
"      see \"Phenytoin: Patient drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Avoid alcohol. May cause drowsiness and impair ability to perform activities requiring mental alertness or physical coordination. Do not change brand or dosage without consulting physician. Do not abruptly discontinue (an increase in seizure activity may result). Maintain good oral hygiene. Antiepileptic agents may increase the risk of suicidal thoughts and behavior; notify physician if you feel more depressed or have thoughts of suicide or self harm. Report chest pain, irregular heartbeat, or palpitations; slurred speech, unsteady gait, coordination difficulties, or change in mentation; skin rash; unresolved nausea, vomiting, or constipation; swollen glands; swollen, sore, or bleeding gums; unusual bruising or bleeding; acute persistent fatigue; vision changes; or other persistent adverse effects. Report worsening of seizure activity or loss of seizure control.",
"    </p>",
