var title_f32_19_33083="Colorectal CA risk factors";
var content_f32_19_33083=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F72216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F72216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Factors associated with an increased and decreased risk of colorectal cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased risk",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Lack of physical activity",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Consumption of red meat",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Obesity",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Cigarette smoking",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Alcohol use",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Decreased risk",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Multivitamins containing folic acid",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Aspirin and other NSAIDs",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Postmenopausal hormone use",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Calcium supplementation",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Selenium",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Consumption of vegetables, fruits, and fiber",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Harvard Report on Cancer Prevention, Cancer Causes and Control 1999; 10:167.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
