var title_f32_19_33084="Differential dx of ITP";
var content_f32_19_33084=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F67855&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F67855&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of idiopathic thrombocytopenia purpura",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Falsely low platelet counts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In vitro platelet clumping caused by EDTA-dependent agglutinins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insufficiently anticoagulated specimen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Presence of giant platelets (may be counted as white blood cells)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Following administration of abciximab",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Common causes of thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Pregnancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Gestational thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Preeclampsia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Drug-induced thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Heparin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Quinine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Sulfonamides",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Antibiotics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Viral infections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        HIV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        infectious mononucleosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hepatitis C virus infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypersplenism due to chronic liver disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Foods and beverages (eg, certain tree nuts, quinine-containing beverages)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Other causes of thrombocytopenia that may mimic ITP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myelodysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acquired pure megakaryocytic aplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Congenital thrombocytopenias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        von Willebrand disease type 2B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Wiskott-Aldrich syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Alport syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        May-Hegglin anomaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fanconi syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Bernard-Soulier syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Thrombocytopenia-absent radius (TAR) syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombotic thrombocytopenic purpura-hemolytic uremic syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic disseminated intravascular coagulation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
