"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F67548&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Food records standard",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"6\">",
"        Instructions for monitoring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <strong>",
"         Column 1 (Time):",
"        </strong>",
"        Note the time when you had anything to eat or drink. Do your best to be accurate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <p>",
"         <strong>",
"          Column 2 (Food/drink consumed):",
"         </strong>",
"         Record exactly what you eat and drink, including any binge eating. Don't leave anything out. Instead of recording calories, write down a simple description of what you eat and drink. Write down each item you eat or drink as soon as possible after you eat it. Trying to remember what it was that you ate or drank later is not a good idea, because it can be unreliable and won't help you change.",
"        </p>",
"        <p>",
"         Monitoring at the time of eating is extremely important. For example, if you are eating out, it can be helpful to record what you are eating during the meal by monitoring in private, like in the restaurant's bathroom.",
"        </p>",
"        <p>",
"         Episodes of eating that you consider to be meals should be bracketed. Do not bracket snacks or other episodes of overeating.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <strong>",
"         Column 3 (Place):",
"        </strong>",
"        Write down where you consumed the food or drink. If you are eating or drinking at home, specify the room.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <strong>",
"         Column 4 (Loss of control?):",
"        </strong>",
"        Place an asterisk (*) in this column if you feel like you were out of control (like you couldn't stop eating or control what, or how much you were eating).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <strong>",
"         Column 5 (V/L/D):",
"        </strong>",
"        Record if and when you vomit or use laxatives or diuretics.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"6\">",
"        <strong>",
"         Column 6 (Context/comments):",
"        </strong>",
"        Use this column like a diary. You should note anything that is going on while you are eating, or anything that is influencing your eating. For example, if you note in column 4 that you felt out of control, record in column 6 the circumstances at the time you were eating. This will help to identify triggers of any times you feel like you overate.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td colspan=\"5\">",
"        &nbsp;",
"       </td>",
